%[text] # Estimate Building HVAC Requirements
%[text] Copyright 2024 - 2026 The MathWorks, Inc.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] ## Build System Model
%[text] In this example, you set up the model created in [Create Building Simscape System Model](file:../CreateBuildingSimscapeSystemModel.mlx) for analysis. First, connect the temperature output of the building to the heat control library block and setup an input for the room temperature set-point. The set point can be a scalar value or a vector of size equal to the number of rooms. In this example, you will use a pre-created model, `BuildingHeatLoadCalc.slx`, saved in the example workflow directory. 
%[text] Open the model.
modelData.LibName = "BuildingThermal"; % Library used to create system model
modelData.Name = "BuildingHeatLoadCalc";        % System model name (pre-created)
open_system(modelData.Name);
%%
%[text] ## Set Weather and Location
%[text] The default library is parameterized to run for seven days. You can modify the default parameterizations using the provided utilities. In this example, you learn how to evaluate HVAC requirements for one full year in a typical European country. Specify location for the analysis.
modelData.Location = getGeoLocationForMajorCities(CityName="Zurich");
%[text] ### Specify Time Duration
%[text] Setup the model to analyze HVAC requirements for one year.
modelData.StartDate = datetime(2024,1,1,1,0,0);
modelData.EndDate = datetime(2024,12,31,1,0,0);
modelData.DateTimeVec = modelData.StartDate:hours(1):modelData.EndDate;
%[text] ### Specify Ambient Temperature
%[text] Specify the average minimum and maximum monthly temperatures for the full year.
modelData.YearTavg = simscape.Value([272,276; 272 278; 275 283; ... % Q1 months (min,max)
                                     278 287; 282 292; 286 295; ... % Q2 months (min,max)
                                     287 297; 284 292; 280 287; ... % Q3 months (min,max)
                                     276 281; 276 281; 272 277],... % Q4 months (min,max)
                                     "K");
%[text] Estimate the daily temperature profile over the full year at the given location.
[modelData.AvgDayT,modelData.AvgDayTvar,... %[output:group:9d15a9f0] %[output:508f9214]
 modelData.AvgNightT,modelData.AvgNightTvar] = ... %[output:508f9214]
            getTemperatureFromYearlyData(... %[output:508f9214]
                              DateTimeVec=modelData.DateTimeVec,... %[output:508f9214]
                              Tavg12MonthData=modelData.YearTavg,... %[output:508f9214]
                              DeltaDegreesNightT=simscape.Value(5,"K"),... %[output:508f9214]
                              Plot=true,... %[output:508f9214]
                              PlotName="Zurich",... %[output:508f9214]
                              Location=modelData.Location,... %[output:508f9214]
                              PercentDayTimeTvar=2,... %[output:508f9214]
                              PercentNightTimeTvar=3); %[output:group:9d15a9f0] %[output:508f9214]
%[text] If you already have the daily temperature data for full year, then use that directly and assign it to parameters `modelData.AvgDayT`, `modelData.AvgDayTvar`, `modelData.AvgNightT`, and `modelData.AvgNightTvar`. In that scenario, do not need to use the `getTemperatureFromYearlyData` utility function .
%[text] ### Parameterize Model
%[text] Parameterize the system model with this datetime, location, and temperature data. The  `setDateTimeAndGeoLocation` function parameterize all relevant blocks requiring the above information.
setDateTimeAndGeoLocation(... %[output:group:289daeed] %[output:9d92c95a]
    BuildingModel=modelData.Name,... %[output:9d92c95a]
    DayLightSavingHours=0,... %[output:9d92c95a]
    Diagnostics=true,... %[output:9d92c95a]
    GeoLocation=modelData.Location,... %[output:9d92c95a]
    StartTime=modelData.StartDate,... %[output:9d92c95a]
    EndTime=modelData.EndDate,... %[output:9d92c95a]
    DayTimeTemperatureVec=modelData.AvgDayT,... %[output:9d92c95a]
    DayTimeTemperatureVar=modelData.AvgDayTvar,... %[output:9d92c95a]
    NightTimeTemperatureVec=modelData.AvgNightT,... %[output:9d92c95a]
    NightTimeTemperatureVar=modelData.AvgNightTvar,... %[output:9d92c95a]
    CalcBuildingIniTemperature=true); %[output:group:289daeed] %[output:9d92c95a]
%[text] Set name-value pair `CalcBuildingIniTemperature` to *true* to enable the initialization of building temerature based on the temperature profile specified above.
%%
%[text] ## Set Operating Conditions
%[text] You can specify the 24hr variation of heat in a room using the `DayScheduler` block. By default, the block is parameterized to specify all rooms with no additional heat source. In this example, specify the heat source uniquely for different rooms in the buildings.
%[text] ### Set 24hr Profile
%[text] Initialize a table to specify heat source in each room.
bldgRoomHeatSrc = initialize24HrRoomData(BuildingLibName=modelData.LibName);
disp(bldgRoomHeatSrc); varRangeTbl = 5:28; %[output:1c38615e]
%[text] The table data has 28 columns. The number of table rows equal the number of rooms in the building. Columns 01:00 to 24:00 specify the heat source value at the corresponding hours. 
%[text] Set heat source in all bedrooms from midnight to 06:00 and from 20:00 to midnight as 200W.
heatSrc24hr = [200,200,200,200,200,200,... % 00:00 - 06:00
               0,0,0,0,0,0,...             % 07:00 - 12:00
               0,0,0,0,0,0,...             % 12:00 - 18:00
               0,200,200,200,200,200];     % 19:00 - 24:00
%[text] Update table data.
n = size(bldgRoomHeatSrc(bldgRoomHeatSrc.RoomName=="Bedroom",varRangeTbl),1);
bldgRoomHeatSrc(bldgRoomHeatSrc.RoomName=="Bedroom",varRangeTbl).Variables = ones(n,24).*heatSrc24hr;
%[text] Set heat source in all Kitchen from 06:00 to 07:00 and from 18:00 to 21:00 as 300W.
heatSrc24hr = [0,0,0,0,0,300,...   % 00:00 - 06:00
               300,0,0,0,0,0,...   % 07:00 - 12:00
               0,0,0,0,0,300,...   % 12:00 - 18:00
               300,300,300,0,0,0]; % 19:00 - 24:00
%[text] Update table data.
n = size(bldgRoomHeatSrc(bldgRoomHeatSrc.RoomName=="Kitchen",varRangeTbl),1);
bldgRoomHeatSrc(bldgRoomHeatSrc.RoomName=="Kitchen",varRangeTbl).Variables = ones(n,24).*heatSrc24hr;
%[text] Plot data for heat source table.
plot24HrRoomData(TableData24Hr=bldgRoomHeatSrc,DataName="Heat Source"); %[output:4eae65cc]
%[text] Parameterize the `DayScheduler` block with the updated table data.
set24HrRoomDataSystemModel(BuildingModel=modelData.Name,DayScheduleHeatSrc=bldgRoomHeatSrc); %[output:7480881b]
clear bldgRoomHeatSrc varRangeTbl heatSrc24hr n
%[text] ### Specify Desired Temperature Set-point
%[text] Set the desired room temperature for HVAC.
modelData.TsetPoint = simscape.Value(293,"K");
%[text] Parameterize the system model.
set_param(modelData.Name+"/Tset","constant",getParamStr(value(modelData.TsetPoint,"K")));
%[text] You can set the temperature set point to be different for each room. In that case, the temperature must be a column vector with size equal to the number of rooms. The **Index** of the room in table `bldgRoomHeatSrc` defines the location of a particular room data in the column vector.
%%
%[text] ## Simulate
set_param(modelData.Name,"StopTime",num2str(max(hours(modelData.EndDate-modelData.StartDate)-1,1)*3600));
modelData.SimResult = sim(modelData.Name);
%%
%[text] ## Results
getMonthlyAveragedData(DateTimeVec=modelData.DateTimeVec(2:end),... %[output:group:3d95f639] %[output:3dbf5887]
                       Data=modelData.SimResult.simlog.HeatControl.Heating.series.values',... %[output:3dbf5887]
                       Plot=true,... %[output:3dbf5887]
                       PlotName="Heating",... %[output:3dbf5887]
                       DisplayData=false,... %[output:3dbf5887]
                       PlotOption="BTU per Hr"); %[output:group:3d95f639] %[output:3dbf5887]
getMonthlyAveragedData(DateTimeVec=modelData.DateTimeVec(2:end),... %[output:group:2a4830c2] %[output:73af0493]
                       Data=modelData.SimResult.simlog.HeatControl.Cooling.series.values',... %[output:73af0493]
                       Plot=true,... %[output:73af0493]
                       PlotName="Cooling",... %[output:73af0493]
                       DisplayData=false,... %[output:73af0493]
                       PlotOption="BTU per Hr"); %[output:group:2a4830c2] %[output:73af0493]

